    border-top-left-radius: 30px;
    border-top-right-radius: 30px;
  }
  input:focus {
    outline: none;
  }
  .title {
    width: 32vw;
    input {
      width: 250px;
      height: 40px;
      margin-top: 50px;
      border: none;
      background-color: #ffeddc;
      color: #ffa249;
      border-radius: 10px;
      padding: 5px;
      font-size: 22px;
      font-weight: bold;
      padding-left: 15px;
      margin-bottom: 20px;
    }
    input::placeholder {
      color: #ffa249;
      font-size: 22px;
      font-weight: bold;
    }
    h1::after {
      content: "";
      display: block;
      width: 200px;
      border-bottom: 3px solid white;
      margin: 20px auto;
    }
  }
  .tagText {
    width: 28vw;
  }
  .tagBox {
    width: 28vw;
    display: flex;
    flex-wrap: wrap;
  }
  .tag {
    width: 100px;
    height: 50px;
    background-color: #ffd6af;
    border-radius: 30px;
    pad
    text-align: center;
  }
  .datas {
    justify-content: center;
    width: 28vw;
    /* display: flex;
    flex-direction: column; */
  }
  .data {
    display: flex;
    align-items: center;
    justify-content: space-between;
    input {
      height: 30px;
      width: 200px;
      border-radius: 7px;
      border: none;
      margin-right: 50px;
      background-color: #ffeddc;
      color: #ffa249;
      font-size: 20px;
      font-weight: bold;
    }
  }
`;

export default Addfood;
